CREATE TRIGGER `trigger_add_mutasi` BEFORE UPDATE ON `c_deposit` FOR EACH ROW BEGIN
	DECLARE new_nominal INT;
    
        IF(new.last_tipe = 'IN') THEN
        SET new_nominal = new.last_nominal * 1;
        ELSE
        SET new_nominal = new.last_nominal * -1;
        END IF;
        
        set new.saldo_awal = old.saldo, new.saldo = old.saldo + new_nominal;
